import React from "react";

function note(name, img, tel, email) {
  return ( < div className = "note" > < h1 > {
      name
    } < /h1><img src={img} alt="celebrity-img" / > < p > {
      tel
    } < /p ><p>{email}</p > < /div> );
  }

  export default note;
